INSERT INTO `tb_subject` (`sj_id`, `sj_name_thai`, `sj_name_eng`, `sj_des_thai`, `sj_des_eng`, `sj_credit`) VALUES
(254251, 'โครงสร้างข้อมูล', 'Data Structure', 'โครงสร้างข้อมูลพื้นฐาน แถวลำดับ กองซ้อน และแถวคอย รายการโยง การเวียนบังเกิด ต้นไม้ค้นหา\r\nแบบทวิภาค ต้นไม้เอวีแอล ฮีป กราฟ และตารางแฮช การประยุกต์ใช้ขั้นตอนวิธีการเรียงลำดับและการค้นหา การหา เส้นทางที่สั้นที่สุดบนกราฟ การหาต้นไม้แบบทอดข้ามที่น้อยที่สุด', 'Basic data structure, array, stacks, queues, linked lists, recursion, binary search\r\ntrees, AVL trees, heaps, graphs, and hash tables, application to sorting and searching algorithm, shortest-paths, minimum spanning tree', '3(2-2-5)'),
(254261, 'สถาปัตยกรรมคอมพิวเตอร์ ', 'Computer Architecture', 'การแทนค่าข้อมูลเชิงจำนวน การคำนวณของเลขมีเครื่องหมาย ไม่มีเครื่องหมาย และเลขทศนิยม นิพจน์ตรรกและสมการบูลลีน ความรู้พื้นฐานด้านวงจรดิจิตอล การจัดเรียงของระบบหน่วยความจำ ความรู้พื้นฐาน ของสถาปัตยกรรมชุดคำสั่ง โครงสร้างของโปรเซสเซอร์สถาปัตยกรรมของโปรเซสเซอร์', 'Representation of numeric data, signed and unsigned arithmetic, and floating-point arithmetic; Logic expressions and Boolean functions; Introduction to digital logic (logic gates, flipflops, circuits); Memory system organization; Introduction to instructi', '3(2-2-5)'),
(254271, 'พื้นฐานทางการเขียนโปรแกรม', 'Fundamentals of Programming', 'แนวคิดของภาษาคอมพิวเตอร์และการเขียนโปรแกรม อัลกอริทึมพื้นฐานที่แสดงโดย ผังงานและรหัสเทียม พื้นฐานการเขียนโปรแกรมที่ครอบคลุมเรื่อง ตัวแปร ชนิดข้อมูลมูลฐาน ตัวกระท ำการ ตรรกะพื้นฐานนิพจน์การรับข้อมูล การแสดงผล และค าสั่งควบคุม อาร์เรย์อาร์เรย์หลายมิติและ ชน', 'Concepts of computer language and programming, fundamental of algorithm represented by flowchart and pseudocode; fundamentals of programming including variables, primitive data type, operators, basic logics, expressions, input, output and control statemen', '3(2-2-5)'),
(254274, 'การโปรแกรมภาษาไพทอน', 'Python Programming', 'แนวคิดเบื้องต้นเกี่ยวกับการเขียนโปรแกรมไพทอน ประกอบด้วย การนำเข้าและนำออก ชนิดข้อมูล เช่น ชุดอักขระ ทูเพิล ลิสต์ดิกชันนารี คำสั่งควบคุมการด าเนินการ การใช้งานฟังก์ชัน การแบ่งโมดูล จัดการกับข้อผิดพลาด การโปรแกรมเชิงวัตถุและการติดต่อผู้ใช้แบบกราฟิก', 'Python programming concept, consist input and output , data types as strings tuples\r\nlists and dictionaries; control flow , functions , modules , error and exception , object-oriented\r\nprogramming, and GUIs (graphical user interfaces).', '3(2-2-5)'),
(254275, 'การเขียนโปรแกรมเชิงวัตถุ', 'Object Oriented Programming', 'เขียนโปรแกรมเชิงวัตถุพื้นฐาน ภาษาที่ใช้ในการเขียนโปรแกรมเชิงวัตถุชนิดข้อมูลแบบนามธรรมในการเขียนโปรแกรมเชิงวัตถุวัตถุคลาส แอททริบิว เมทอดและเมทอดโอเวอร์โหลด คอนสตัคเตอร์ดีสตัคเตอร์ การห่อหุ้มข้อมูลและการซ่อนข้อมูล การทำคสาสคอมโพสิชั่น การสืบทอด การทำงานแบบ', 'Introductory object oriented programming and language, abstract data types in object-oriented programming, objects, classes, attributes, methods and method overloading, constructor and destructor, encapsulation and information hiding, class composition, i', '3(2-2-5)'),
(254276, 'คณิตศาสตร์เต็มหน่วยสำหรับวิทยาการคอมพิวเตอร์', 'Discrete Mathematics for Computer Science', 'เซต วิธีการนับ ความสัมพันธ์และฟังก์ชัน ตรรกศาสตร์ วิธีการพิสูจน์และอุปนัยวิธีทางคณิตศาสตร์ ความน่าจะเป็นแบบไม่ต่อเนื่อง ความสัมพันธ์เวียนบังเกิด ฟังก์ชันก่อก าเนิด ทฤษฎีจำนวน อัลกอริทึม กราฟและต้นไม้ การโมเดลเชิงค านวณ เน้นการประยุกต์ใช้ในสาขาวิทยาการคอมพ', 'Sets, counting methods, relations and functions, logic, methods of proof and mathematical induction, discrete probability, recurrence relation, generating function, number theory, algorithm, graph and tree, modeling computation, emphasis on applications i', '3(2-2-5)'),
(254341, 'วิธีการเชิงตัวเลข', 'Numerical Methods', 'ความคลาดเคลื่อนของการประมาณ การหาผลเฉลยของระบบสมการเชิงเส้นและระบบสมการที่ไม่เป็นเชิงเส้น เทคนิคการประมาณค่าของฟังก์ชัน การประมาณค่าในช่วงอนุพันธ์และอินทิกรัลเชิงตัวเลข ฝึก\r\nการใช้โปรแกรมส าเร็จรูปที่เกี่ยวกับการคำนวณเชิงตัวเลข', 'Error of approximation, finding solution of linear and nonlinear equations, techniques function of approximation, numerical solution of ordinary differential equations and numerical integration, practice with numerical packages ', '3(2-2-5)'),
(254351, 'ระบบฐานข้อมูล', 'Database Systems', 'แนวคิดเบื้องต้นเกี่ยวกับฐานข้อมูล การจัดการฐานข้อมูล โครงสร้างหน่วยเก็บข้อมูลของฐานข้อมูล ตัวแบบและภาษาของฐานข้อมูล การนอร์มอลไลซ์ตัวแบบความสัมพันธ์การออกแบบฐานข้อมูล ความถูกต้องและความปลอดภัยของฐานข้อมูล', 'Concepts, approach and techniques in database management system &#40;DBMS&#41;, relational databases, querying and updating a database, query language SQL, database constraints and design and implementation, entity relationship and relational data model, ', '3(2-2-5)'),
(254352, 'วิธีการพัฒนาซอฟต์แวร์และเครื่องมือ', 'Software Development Methods and Tools', 'โครงการพัฒนาซอฟต์แวร์แบบจำลองของกระบวนการพัฒนาซอฟต์แวร์การเก็บข้อมูล การวิเคราะห์ปัญหา การวิเคราะห์ความต้องการ การสร้างข้อกำหนดความต้องการ การทำแบบจำลองซอฟต์แวร์การออกแบบส่วนติดต่อผู้ใช้การทำระบบต้นแบบ การประเมินผล การใช้เครื่องมือทางซอฟต์แวร์เพื่อการประย', 'Software development project, software process models, data gathering, problems Analysis, requirements analysis, requirements specification, software modeling, User Interface design, system prototyping, system evaluation, software tools and real-world cas', '3(2-2-5)'),
(254361, 'ระบบปฏิบัติการ', 'Operating Systems', 'แนวคิดเบื้องต้นของระบบปฏิบัติการ การจัดการทรัพยากรของคอมพิวเตอร์วิธีการและแนวทางของระบบหลายโปรแกรม การติดต่อ และประสานงานของระบบหลายโปรแกรม การจัดสรรหน่วยความจำหลักและหน่วยความจำเสมือน การโปรแกรมรับเข้าและส่งออก การจัดการเกี่ยวกับการขัดจังหวะ', 'Concepts of operating system, resource allocation and management, system utility, multiprogramming, interprocess communication, memory management, input/ output principles and programming, interrupt', '3(2-2-5)'),
(254362, 'การสร้างคอมไพเลอร์', 'Compiler Construction', 'แนวคิดเบื้องต้นเกี่ยวกับคอมไพเลอร์การวิเคราะห์พจนานุกรม การก ำหนดขอบเขตจำกัดของเครื่องเทคนิควจีภาคเบื้องต้น การก่อกำเนิดรหัสของเครื่อง การค้นหาสิ่งผิดพลาด การจัดการหน่วยความจำที่น้อยที่สุด การสร้างวัฏจักรที่ดีการสร้างตัวแปล (คอมไพเลอร์หรืออินเตอร์พรีเตอร์', 'Compiling concepts, lexical analysis, finite state machine, parsing, code generation, type checking, storage-allocation strategies, code optimization, construction of compiler or interpreter', '3(2-2-5)'),
(254363, 'เครือข่ายคอมพิวเตอร์และการสื่อสารข้อมูล', 'Computer Network and Data Communication', 'หลักการพื้นฐานของการสื่อสารข้อมูลในเครือข่ายคอมพิวเตอร์เทคโนโลยีที่ใช้ในโครงสร้างพื้นฐานหน้าที่ของโครงสร้าง และความปลอดภัยบนเครือข่ายเบื้องต้น โดยที่การเรียนหัวข้อเหล่านี้จะศึกษาผ่านหลักสูตรออนไลน์ของซิสโก้อันประกอบไปด้วย การเรียนเกี่ยวกับระบบเครือข่ายเบื', 'The basic principles of data communications and the technological infrastructure underlying networks; The role of these infrastructures is described including fundamentals of network security; This course also delivers the Cisco CCNA Certification curricu', '3(2-2-5)'),
(254364, 'ไมโครโพรเซสเซอร์และไมโครคอนโทลเลอร์', 'Microprocessor and Microcontrollers', 'พื้นฐานไมโครโพรเซสเซอร์และไมโครคอนโทรลเลอร์สถาปัตยกรรมภายใน ชุดคำสั่งและรีจิสเตอร์ การเขียนโปรแกรม ระบบรีเซท ขัดจังหวะ สัญญาณเวลาต่างๆ การเชื่อมต่อกับหน่วยความจำ การเชื่อมต่อกับอุปกรณ์นำเข้า-ส่งออก การเชื่อมต่อแบบขนานและอนุกรม และการนำไมโครโพรเซสเซอร์และไ', 'Introduction to microprocessors and microcontrollers, architectures, instruction/register set, programming, reset/interrupt/clock/timer systems, memory maps,\r\ninput/output, parallel/serial interfacing, and applications.', '3(2-2-5)'),
(254371, 'การโปรแกรมบนอินเทอร์เน็ต', 'Internet Programming', 'หลักการพื้นฐานเกี่ยวกับโพรโตคอล TCP/IP, HTTP, FTP, SMTP,และ SNMP ระบบไคลเอนต์และเซิร์ฟเวอร์พื้นฐานการเขียนชุดคำสั่งเอชทีเอ็มแอล พื้นฐานการเขียนซีเอสเอส หลักการโปรแกรมบนเว็บฝั่งไคลเอนต์เซิร์ฟเวอร์การเขียนโปรแกรมเว็บฐานข้อมูล การเขียนโปรแกรมประยุกต์', 'Fundamental knowledge in TCP/IP, HTTP, FTP, SMTP, and SNMP protocols, client and server concepts, HTML basic, CSS basic, fundamentals of client-server web programming, webdatabase programming, and internet application programming\r\n', '3(2-2-5)'),
(254372, 'เทคโนโลยีภาษาจาวา', 'Java Technology', 'แนวคิดเบื้องต้นเกี่ยวกับความสามารถต่างๆ ในภาษาจาวา ได้แก่จาวาบีนส์การเขียนโปรแกรมเซิร์ฟเลท การเชื่อมต่อภาษาจาวากับฐานข้อมูล การรับส่งข้อมูลระยะไกลและสวิง รวมทั้งการเขียนโปรแกรมเครือข่ายแบบอนุกรม คุณสมบัติความปลอดภัย คลาสและสถาปัตยกรรมของคลาสต่างๆ', 'Java features concept such as javabeans, servlet programming, java database connectivity, remote method invocation and swing, include network programming serialization, properties, security, the collection classes and architectures.', '3(2-2-5)'),
(254374, 'การวิเคราะห์และออกแบบระบบ', 'System Analysis and Design', 'การเก็บข้อมูล การวิเคราะห์ปัญหา โครงการพัฒนาระบบสารสนเทศ กระบวนวิธีการพัฒนาระบบ การวิเคราะห์ความต้องการ การจัดทำข้อกำหนดความต้องการ แบบจำลองข้อมูล การออกแบบฐานข้อมูลแบบจำลองการประมวลผลข้อมูล หลักการพื้นฐานการออกแบบเชิงวัตถุ แบบจำลองของซอฟต์แวร์เชิงวัตถุแล', 'Data gathering, problem analysis, information system development project, system development methodology, requirement analysis, requirement specification, data model, database design, data processing model, object-oriented design principles, object-orient', '3(2-2-5)'),
(254382, 'เทคนิคการทำเหมืองข้อมูล', 'Data Mining Techniques', 'แนวคิดเบื้องต้นเกี่ยวกับคลังข้อมูลและการทำเหมืองข้อมูล การเตรียมข้อมูลสำหรับการทำเหมืองข้อมูล เทคนิคการทำเหมืองข้อมูลต่าง ๆ สำหรับการประมาณและการพยากรณ์ การจัดกลุ่มข้อมูล การจำแนกประเภทข้อมูล การวิเคราะห์กฎความสัมพันธ์ต้นไม้ตัดสินใจ กฎของเบย์โครงข่ายประสา', 'Data warehouse and data mining concept, data preparation, techniques in the field of data mining for data estimation and prediction, data clustering, data classification, association rule, decision tree, Bayesian rule, neural networks, and data mining app', '3(2-2-5)'),
(254383, 'การออกแบบและวิเคราะห์อัลกอริทึม ', 'Algorithm Design and Analysis', 'แนวคิดเบื้องต้นเกี่ยวกับการออกแบบและวิเคราะห์อัลกอริทึม สัญลักษณ์เชิงเส้นกำกับ การวิเคราะห์เชิงเส้นกำกับ อัลกอริทึมแบ่งแยกและเอาชนะ การโปรแกรมแบบพลวัต อัลกอริทึมเชิงละโมบ เอ็นพีบริบูรณ์', 'Algorithm design and analysis concept, asymptotic notations, asymptotic analysis, divide and conquer algorithm, dynamic programming, greedy algorithms, NP-completeness', '3(2-2-5)'),
(254384, 'การประมวลผลแบบกลุ่มเมฆ', 'Cloud Computing', 'ภาพรวมของการประมวลผลแบบกลุ่มเมฆหรือคลาวด์ซึ่งประกอบด้วย ลักษณะสำคัญของคลาวด์ รูปแบบของคลาวด์(เช่น คลาวด์ภายในองค์กร คลาวด์สาธารณะ และคลาวด์ลูกผสม) ประเภทการให้บริการของคลาวด์(คลาวด์ประเภทให้บริการโครงสร้างพื้นฐานทางไอทีคลาวด์ประเภทให้บริการแพลตฟอร์ม คลาวด', 'An overview of cloud computing or cloud including its key characteristics, features(such as private, public, and hybrid cloud), delivery models (Infrastructure as a Service/IaaS, Platform as a Service/PaaS, and Software as a Service/SaaS), and its deploym', '3(2-2-5)'),
(254385, 'การโปรแกรมแบบขนานสำหรับคอมพิวเตอร์กราฟิกส์ ', 'Parallel Programming for Computer Graphics', 'หน่วยประมวลผลกราฟิกส์ตัวแบบโปรแกรมบนหน่วยประมวลผลกราฟิกส์ฮาร์ดแวร์ของหน่วยประมวลผลกราฟิกส์และการสื่อสารแบบขนาน พื้นฐานขั้นตอนวิธีสำหรับหน่วยประมวลผลกราฟิกส์การทำให้\r\nโปรแกรมบนหน่วยประมวลผลกราฟิกส์มีประสิทธิภาพ แบบอย่างการประมวลผลแบบขนาน', 'Graphics processing unit, graphics processing unit programming model, graphics processing unit hardware and parallel communication, fundamental graphics processing unit algorithms, optimizing graphics processing unit programs, parallel computing patterns', '3(2-2-5)'),
(254386, 'ความรู้พื้นฐานด้านหุ่นยนต์', 'Introduction to Robotics', 'การแก้ปัญหาโดยใช้หุ่นยนต์และการเขียนโปรแกรม การสร้างหุ่นยนต์ประกอบโดยใช้ชิ้นส่วนสำเร็จรูป การควบคุมแบบใช้สัญญาณตอบกลับ แบบใช้อัลกอริทึม และแบบใช้ปฏิกิริยาตอบสนอง การหลบหลีกสิ่งกีดขวาง และรูปแบบการควบคุมอื่นๆ โครงงานสำหรับผู้เรียนเพื่อให้ออกแบบและเขียนโปรแ', 'Problem solving with robotics through programming, construction of brick-based robots, feedback control, algorithmic control, and reactive control, obstacle avoidance and various control strategies, project assignment for designing and programming robots ', '3(2-2-5)'),
(254387, 'ความมั่นคงปลอดภัยของระบบเครือข่าย ', 'Network Security', 'หัวข้อพื้นฐานในระบบความมั่นคงปลอดภัยในหลายๆ ด้าน เช่น ความลับ ความแท้จริง สิทธิในการเข้าถึงความสมบูรณ์ความพร้อมบริการ ความรับผิดชอบการกระทำ การเป็นนิรนาม และอื่นๆ เทคนิคต่างๆ ในการบุกรุกระบบเครือข่ายและการป้องกัน การเข้ารหัสเบื้องต้นทั้งแบบใช้กุญแจลับ และ', 'Various aspects of principles of security, confidentiality, authenticity, authority,\r\nintegrity, availability, accountability, anonymity, techniques in attacking existing computer networks\r\nand their protection, basic cryptography, secret-key and public-k', '3(2-2-5)'),
(254451, 'วิศวกรรมซอฟต์แวร์', 'Software Engineering', 'ความหมาย ขอบเขต และประโยชน์ของวิศวกรรมซอฟต์แวร์กระบวนการซอฟต์แวร์การวิเคราะห์ ความต้องการและขอบเขตข้อจำกัดของซอฟต์แวร์การออกแบบซอฟต์แวร์ สถาปัตยกรรมซอฟต์แวร์การพัฒนา  ซอฟต์แวร์การวางแผนงานโครงงานซอฟต์แวร์การประยุกต์ใช้เครื่องมือและแอพพลิเคชันของโปรแกรมคอม', 'Meaning, scope and advantage of software engineering, software process, software\r\nrequirement analysis, software design, software architecture, software development, software projects management, using tools and environments and applications of computer p', '3(2-2-5)'),
(254461, 'การสื่อสารข้อมูลขั้นสูง', 'Advanced Data Communications', 'แนวคิดเบื้องต้นเกี่ยวกับการพัฒนาเครือข่ายท้องถิ่นให้มีประสิทธิภาพและคุ้มค่ามากที่สุดโดยใช้เทคนิคการจัดการไอพีแอดเดรส (VLSM) โปรโตคอลการหาเส้นทางขั้นสูง (เช่น OSPF) และการคอนฟิกสวิทส์เนื้อหาที่เกี่ยวข้องกับเทคโนโลยีWAN เช่น ISDN และ Frame relay เป็นต้นจะช่', 'Concepts of develop the effective LANs with technological infrastructure such as IP\r\naddress scheme (VLSM), advanced routing protocols (Such as OSPF) and switched configuration;\r\nWAN technologies are provided in order to gain more understanding in network', '3(2-2-5)'),
(254471, 'ภาษาคอมพิวเตอร์สมัยใหม่', 'Modern Computer Languages', 'ภาษาทางคอมพิวเตอร์มาตรฐานทางภาษาคอมพิวเตอร์และ เทคโนโลยีทางภาษาคอมพิวเตอร์ ที่นิยมใช้อยู่ปัจจุปัน', 'Modern computer programming languages, their standards and technologies.', '3(2-2-5)'),
(254472, 'ภาษาโปรแกรม', 'Programming Languages', 'การแบ่งชนิดภาษาที่ใช้ในการเขียนโปรแกรม ปัจจัยที่มีผลต่อการออกแบบภาษาจากอดีตจนถึงปัจจุบัน เปรียบเทียบภาษาตามคุณสมบัติการอ่าน การเขียน เป็นต้น ตัวอย่างภาษาที่เป็นตัวแทนของแต่ละชนิดโครงสร้างและลักษณะสำคัญของภาษาแต่ละแบบความหมายของ ตัวแปร ชนิดข้อมูลแบบต่างๆ ช', 'Classification of programming languages, factors for the language design from the past to this present, criteria for language evaluation and comparison e.g. readability and writability, language examples for each classification, general structure of progr', '3(2-2-5)'),
(254481, 'คอมพิวเตอร์กราฟิกส์', 'Computer Graphics', 'คณิตศาสตร์พื้นฐานส าหรับคอมพิวเตอร์กราฟิกส์ตัวแทนร่างแหสามเหลี่ยม การขึ้นรูปทรง แมทีเรียล การปะติดพื้นผิวด้วยภาพ กระบวนการสร้างภาพสองมิติจากตัวแบบ การแทนเส้นโค้งและพื้นผิว การทำให้เคลื่อนไหว ซอฟต์แวร์ส าหรับการขึ้นรูปทรงสามมิติ เครื่องประมวลการสร้างภาพ', 'Fundamental mathematics for computer graphics, triangle mesh representation, modeling, material, texturing, rendering, representation of curve and surface, animation, 3D modeling software, render engine', '3(2-2-5)'),
(254482, 'ปัญญาประดิษฐ์', 'Artificial Intelligence', 'ประเด็นพื้นฐานของปัญญาประดิษฐ์กลยุทธ์การค้นหาเบื้องต้น การเล่นเกม การแทนความรู้การให้เหตุผลบนพื้นฐานความรู้ ระบบผู้เชี่ยวชาญ การให้เหตุผลด้วยกรณีศึกษา การเรียนรู้ของเครื่องจักร โครงข่ายใยประสาท การคำนวณเชิงวิวัฒนาการ ตัวแทนปัญญา การวางแผน หุ่นยนต', 'Fundamental issues of artificial intelligence, basic search strategies, game playing, knowledge representation, knowledge based reasoning, expert system, case-based reasoning, machine learning, neuron network, evolutionary computation, Intelligent agent, ', '3(2-2-5)'),
(254483, 'การตรวจวัดสัญญาณและการดำเนินงานสำหรับอินเทอร์เน็ตของสรรพสิ่ง', 'Sensing and Actuation for Internet of Things', 'การรับและประมวลผลข้อมูลจากเครื่องตรวจวัดสัญญาณ และการดำเนินการสั่งงานมอเตอร์ไฟแอลอีดีและอุปกรณ์อื่นๆ ผ่านทางอุปกรณ์คอมพิวเตอร์แบบฝังหรือเคลื่อนที่ซึ่งใช้ในอินเทอร์เน็ตของสรรพสิ่ง แนวคิดเกี่ยวกับการสุ่มตัวอย่างความถี่ ขนาดความกว้างของบิตที่เหมาะสม รวมถึงกา', 'Data acquisition and processing from sensors, and actuation of motors, LEDs, etc. via embedded computing or mobile-enabled products used in the Internet of Things (IoT). Sampling frequency, bit-width requirement, analog-to-digital, and digital-to-analog c', '3(2-2-5)'),
(254486, 'วิทยาศาสตร์ข้อมูล ', 'Data Science', 'การจัดการในเรื่องของการเก็บและรวบรวมข้อมูล ค้นหารูปแบบและความสัมพันธ์ที่ซ่อนอยู่ในชุดข้อมูลขนาดใหญ่ โดยใช้ขั้นตอนวิธีการทำเหมืองข้อมูล ศาสตร์ทางด้านสถิติเทคนิคต่างๆของการเรียนรู้ของเครื่องเพื่อให้ได้โมเดลที่มีความถูกต้องสูง นำไปสู่การวิเคราะห์พร้อมทั้งแสด', 'Data management solutions; Data mining algorithms and practical statistical andmachine learning concepts for analyzing and mining patterns in largescale datasets, Design effective visualizations results', '3(2-2-5)'),
(254491, 'สัมมนา', 'Seminar', 'สัมมนาปัญหาพิเศษที่เกี่ยวข้องกับสาขาวิชาวิทยาการคอมพิวเตอร์ตลอดจนประเด็นทางสังคม และจริยธรรมในวิชาชีพ ได้แก่ความรู้เกี่ยวกับทรัพย์สินทางปัญญา กฎหมายกับงานเทคโนโลยี ความรู้เกี่ยวกับองค์กรหลักจริยธรรมส าหรับการทำงานอย่างมืออาชีพ ความรู้ความเข้าใจเกี่ยวกับคว', 'Seminar in special problems of computer science topics or related fields, for example, social context of computing , intellectual property , legal issues in computing, organizational context, professional and ethical issue, privacy and civil liberties', '1(0-2-1)'),
(273100, 'ประวัติและพัฒนาการของเทคโนโลยีคอมพิวเตอร์ ', 'History and Development of Computer Technology', 'ประวัติและพัฒนาการของคอมพิวเตอร์ เทคโนโลยีสารสนเทศและเทคโนโลยีการสื่อสาร รวมถึงวิวัฒนาการภาษาที่ใช้ในคอมพิวเตอร์และวิวัฒนาการด้านอินเทอร์เน็ต บทบาทและความส าคัญของเทคโนโลยีคอมพิวเตอร์ในยุคปัจจุบัน วิชาชีพและงานด้านเทคโนโลยีสารสนเทศและวิทยาการคอมพิวเตอร์กฎ', 'History and Development of Computer, Information Technology and Telecommunication Technology, Evolution of programming languages and the Internet, Current roles and importance of Technology Computer, Professionals and careers in Computer and\r\nInformation ', '1(1-0-2)'),
(273382, 'เทคโนโลยีมัลติมีเดียและเว็บ', 'Multimedia and Web Technology', 'ความรู้เบื้องต้นเกี่ยวกับอินเทอร์เน็ต ระบบเว็บและโพรโทคอลเอชทีทีพี ทฤษฎีการออกแบบเว็บเพจ มโนคติเกี่ยวกับการนำเสนอมาตรฐานเกี่ยวกับการพัฒนาเว็บ องค์กรที่พัฒนาเกี่ยวกับมาตรฐานเว็บ ภาษามาร์คอัพที่ใช้ในการแสดงผลบนเว็บ การโปรแกรมทางฝั่งไคลเอนต์ การโปรแกรมทางฝั่', 'Inroduction to the Internet, web and HTTP protocol, web page design theory, presentation abstractions, web standard, standards bodies, web-markup and display languages, client-side programming, server-side programming, web services, web server technologie', '3(2-2-5)'),
(273488, 'การประมวลผลรูปภาพดิจิทัล', 'Digital Image Processing', 'แนวคิดพื้นฐานในกระบวนการประมวลผลภาพดิจิทัล การแปลงภาพ การปรับปรุงภาพ การบูรณะ ภาพการบีบอัดภาพ การหาขอบภาพ การแบงส่วนภาพ การเทียบเคียงแผ่นแบบ การดึงลักษณะสำคัญเบื้องต้น ได้แก่ สี ขอบ รูปร่าง พื้นผิว เป็นต้น การจำแนกรูปภาพ การรู้จ ารูปภาพ การใช้งานโปรแกรมสำ', 'Fundamental concepts of digital image processing, image transformation, image enhancement, image restoration, image compression, edge detection, Image segmentation and template matching. Feature extraction such as color, edges, shape and texture. Image cl', '3(2-2-5)');
