('F05002', '05002', 'รองศาสตราจารย์ ประศาสตร์ บุญสนอง', 'Assoc.Prof.Prasart Boonsnong'),
('F05016', '05016', 'ผู้ช่วยศาสตราจารย์ ดร.วินัย วงษ์ไทย', 'Asst.Prof.Dr.Winai Wongthai'),
('F05019', '05019', 'ผู้ช่วยศาสตราจารย์ ดร.สัญญา เครือหงษ์', 'Asst.Prof.Dr.Sanya Khruahong');
